import React, { useState, useEffect } from 'react';
import { useSearchParams, useNavigate } from 'react-router-dom';
import './DrinkDiagram.css';
import Navbar from '../components/Navbar';
import UserInfoModal from '../components/UserInfoModal';

// A simple ring diagram component using an SVG circle.
function RingDiagram({ percentage }) {
  const radius = 60;
  const circumference = 2 * Math.PI * radius;
  const offset = circumference - (percentage / 100) * circumference;

  return (
    <svg width="150" height="150" className="ring-diagram">
      <circle
        className="ring-background"
        stroke="#eee"
        strokeWidth="12"
        fill="transparent"
        r={radius}
        cx="75"
        cy="75"
      />
      <circle
        className="ring-progress"
        stroke="#3f51b5"
        strokeWidth="12"
        fill="transparent"
        r={radius}
        cx="75"
        cy="75"
        strokeDasharray={circumference}
        strokeDashoffset={offset}
      />
      <text x="75" y="80" textAnchor="middle" fontSize="20" fill="#333">
        {percentage}%
      </text>
    </svg>
  );
}

export default function DrinkDiagram() {
  const [searchParams] = useSearchParams();
  const drink = searchParams.get('drink') || '';
  const [userInfoModalOpen, setUserInfoModalOpen] = useState(false);
  const [allowedPercentage, setAllowedPercentage] = useState(0);
  const navigate = useNavigate();

  // Assume user data is stored in localStorage after sign-in.
  const storedUser = localStorage.getItem('bacshotsUser');
  let user = storedUser ? JSON.parse(storedUser) : null;

  // Check if user weight, sex (or other needed info) are missing.
  useEffect(() => {
    if (!user || !user.weight || !user.sex) {
      setUserInfoModalOpen(true);
    } else {
      // Compute allowed percentage of alcohol (dummy math):
      // For example: allowed = (weight factor) * (sex factor) * some constant.
      // You can refine this calculation as needed.
      const weightFactor = user.weight / 150; // assume 150 lbs is baseline
      const sexFactor = user.sex === 'male' ? 1 : 0.8;
      // Also consider the drinkâ€™s abv if you fetched that info.
      // For now, we simulate that higher abv means lower allowed percentage.
      // In a real app, you might fetch the drink details from your API.
      let drinkAbv = 5; // default for beer
      if (drink.toLowerCase().includes("whiskey") || drink.toLowerCase().includes("vodka") || drink.toLowerCase().includes("tequila")) {
        drinkAbv = 40;
      } else if (drink.toLowerCase().includes("cider") || drink.toLowerCase().includes("cocktail")) {
        drinkAbv = 12;
      }
      // Calculate a dummy allowed percentage:
      const allowed = Math.min(100, Math.round(100 * (weightFactor * sexFactor * 50 / drinkAbv)));
      setAllowedPercentage(allowed);
    }
  }, [user, drink]);

  // Once user info is provided, you might update the user in localStorage.
  // (Assume UserInfoModal calls a callback to update user info.)
  const handleUserInfoUpdate = (newUserData) => {
    user = { ...user, ...newUserData };
    localStorage.setItem('bacshotsUser', JSON.stringify(user));
    setUserInfoModalOpen(false);
    // Re-run the calculation.
    const weightFactor = user.weight / 150;
    const sexFactor = user.sex === 'male' ? 1 : 0.8;
    let drinkAbv = 5;
    if (drink.toLowerCase().includes("whiskey") || drink.toLowerCase().includes("vodka") || drink.toLowerCase().includes("tequila")) {
      drinkAbv = 40;
    } else if (drink.toLowerCase().includes("cider") || drink.toLowerCase().includes("cocktail")) {
      drinkAbv = 12;
    }
    const allowed = Math.min(100, Math.round(100 * (weightFactor * sexFactor * 50 / drinkAbv)));
    setAllowedPercentage(allowed);
  };

  return (
    <div className="drink-diagram-container">
      <Navbar onSignOut={() => {
        localStorage.removeItem('bacshotsUser');
        window.location.href = '/signin';
      }} />
      <div className="drink-diagram-content">
        <h1>Tonight, you're drinking:</h1>
        <h2 className="drink-name">{drink}</h2>
        <RingDiagram percentage={allowedPercentage} />
        <button className="back-btn" onClick={() => navigate('/im-drinking')}>
          Back
        </button>
      </div>
      {userInfoModalOpen && (
        <UserInfoModal onClose={handleUserInfoUpdate} />
      )}
    </div>
  );
}
